import React from 'react'

const Pokecard = (props) => {
  const {name, type, base_experience} = props
  return (
    <div className='Pokecard'>
      <h4>{name}</h4>
      <p>Type: {type}</p>
      <p>EXP: {base_experience}</p>
    </div>
  )
}

export default Pokecard
